using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using UnityEngine;

namespace BeatSaverDownloader.Misc
{
    class Base64Sprites
    {
        public static Sprite AddToFavorites;
        public static Sprite RemoveFromFavorites;
        public static Sprite StarFull;
        public static Sprite StarEmpty;
        public static Sprite BeastSaberLogo;
        public static Sprite ReviewIcon;
        public static Sprite ThumbUp;
        public static Sprite ThumbDown;
        public static Sprite PlaylistIcon;
        public static Sprite SongIcon;
        public static Sprite DownloadIcon;
        public static Sprite PlayIcon;


        public static string AddToFavoritesB64      = @"";
        public static string RemoveFromFavoritesB64 = @"";
        public static string StarFullB64 = @"";
        public static string StarEmptyB64 = @"";

        //by elliotttate#9942
        public static string BeastSaberLogoB64 = @"";
        public static string ReviewIconB64 = @"";

        //https://www.flaticon.com/free-icon/thumbs-up_70420
        public static string ThumbUpB64 = @"";

        //https://www.flaticon.com/free-icon/dislike-thumb_70485
        public static string ThumbDownB64 = @"";

        //https://www.flaticon.com/free-icon/playlist_727239
        public static string PlaylistIconB64 = @"";

        //https://www.flaticon.com/free-icon/musical-note_727218
        public static string SongIconB64 = @"";

        //https://www.flaticon.com/free-icon/download_724933
        public static string DownloadIconB64 = @"";

        //https://www.flaticon.com/free-icon/media-play-symbol_31128
        public static string PlayIconB64 = @"";
        
        public static void ConvertToSprites()
        {
            Logger.Log("Creating sprites...");

            AddToFavorites = Base64ToSprite(AddToFavoritesB64);
            RemoveFromFavorites = Base64ToSprite(RemoveFromFavoritesB64);
            StarFull = Base64ToSprite(StarFullB64);
            StarEmpty = Base64ToSprite(StarEmptyB64);
            BeastSaberLogo = Base64ToSprite(BeastSaberLogoB64);
            ReviewIcon = Base64ToSprite(ReviewIconB64);
            ThumbUp = Base64ToSprite(ThumbUpB64);
            ThumbDown = Base64ToSprite(ThumbDownB64);
            PlaylistIcon = Base64ToSprite(PlaylistIconB64);
            SongIcon = Base64ToSprite(SongIconB64);
            DownloadIcon = Base64ToSprite(DownloadIconB64);
            PlayIcon = Base64ToSprite(PlayIconB64);

            Logger.Log("Creating sprites... Done!");
        }

        public static string SpriteToBase64(Sprite input)
        {
            return Convert.ToBase64String(input.texture.EncodeToPNG());
        }

        public static Sprite Base64ToSprite(string input)
        {
            string base64 = input;
            if (input.Contains(","))
            {
                base64 = input.Substring(input.IndexOf(','));
            }
            Texture2D tex = Base64ToTexture2D(base64);
            return Sprite.Create(tex, new Rect(0, 0, tex.width, tex.height), (Vector2.one / 2f));
        }

        public static Texture2D Base64ToTexture2D(string encodedData)
        {
            byte[] imageData = Convert.FromBase64String(encodedData);

            Texture2D texture = new Texture2D(0, 0, TextureFormat.ARGB32, false, true);
            texture.hideFlags = HideFlags.HideAndDontSave;
            texture.filterMode = FilterMode.Trilinear;
            texture.LoadImage(imageData);
            return texture;
        }
    }
}
